import useDarkMode from 'use-dark-mode';
const TopNavbar = () => {
  const darkMode = useDarkMode(false);
  return (
    <div>
      <a href="#home">Home</a>
      <a href="#news">News</a>
      <a href="#contact">Contact</a>
      <style jsx>
        {`
        overflow: hidden;
        background-color: #333;
	      right:40px;
        position: fixed;
        top: 0;
        width: 100%;
        display: flex;
        a{
          float: left;
          color: #f2f2f2;
          text-align: center;
          text-decoration: none;
          font-size: 17px;
        }
        `}
      </style>
    </div>
  );
};

export default TopNavbar;
